/*Table structure for table `trabajador` */

DROP TABLE IF EXISTS `trabajador`;

CREATE TABLE `trabajador` (
  `idpersonal` int(11) NOT NULL AUTO_INCREMENT,
  `idusuario` int(11) NOT NULL,
  `idempresa` int(11) NOT NULL,
  `sueldo` decimal(10,2) DEFAULT NULL,
  `accsistema` int(1) NOT NULL DEFAULT '0',
  `estado` int(1) NOT NULL DEFAULT '1',
  PRIMARY KEY (`idpersonal`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `trabajador` */

/*Table structure for table `ubigeo` */

DROP TABLE IF EXISTS `ubigeo`;

CREATE TABLE `ubigeo` (
  `idubigeo` int(11) NOT NULL AUTO_INCREMENT,
  `ubigeo` varchar(200) NOT NULL,
  `pais` varchar(150) NOT NULL,
  `departamento` varchar(150) DEFAULT NULL,
  `provincia` varchar(150) DEFAULT NULL,
  `distrito` varchar(150) DEFAULT NULL,
  `estado` int(1) DEFAULT '1',
  PRIMARY KEY (`idubigeo`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;

/*Data for the table `ubigeo` */

