/* Procedure structure for procedure `f_buscarPersonal` */

/*!50003 DROP PROCEDURE IF EXISTS  `f_buscarPersonal` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `f_buscarPersonal`(_desc VARCHAR(50))
BEGIN
	SELECT nrodocumento,nombre,apepat,apemat,
	idpersonal 
	FROM personal 
	WHERE upper(CONCAT(nombre,' ',apepat,' ',apemat)) like UPPER(CONCAT('%',_desc ,'%'));
    END */$$
DELIMITER ;

/* Procedure structure for procedure `f_buscarPersonalDni` */

/*!50003 DROP PROCEDURE IF EXISTS  `f_buscarPersonalDni` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `f_buscarPersonalDni`(_dni VARCHAR(50))
BEGIN
	SELECT idpersonal,UPPER(CONCAT(nombre,' ',apepat,' ',apemat)) nombres 
	FROM personal 
	WHERE nrodocumento =_dni;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `f_reportedia` */

/*!50003 DROP PROCEDURE IF EXISTS  `f_reportedia` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `f_reportedia`(_fecha varchar(50))
BEGIN
	SELECT DISTINCT
	     asistencias.`nrodocumento` AS asistencias_nrodocumento,
	     asistencias.`personal` AS asistencias_personal,
	     asistencias.`hingreso` AS asistencias_hingreso,
	     asistencias.`hsalidarefrigerio` AS asistencias_hsalidarefrigerio,
	     asistencias.`hentradarefrigerio` AS asistencias_hentradarefrigerio,
	     asistencias.`hsalida` AS asistencias_hsalida,
	     asistencias.`tardanza` AS mintos_tardanza,
	     asistencias.`falta` AS faltas,
	     asistencias.`fecha` AS asistencias_fecha,
	     asistencias.`justificacion` AS justificacion,
	     asistencias.`permisos` AS permisos,
	     personal.`categoria` AS categoria
	FROM `asistencias` asistencias INNER JOIN `personal` personal	
	WHERE personal.`idpersonal` = asistencias.`idpersonal`
	AND asistencias.`fecha`=_fecha
	ORDER BY personal.`categoria`,asistencias.`personal`;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `spActualizarProductos` */

/*!50003 DROP PROCEDURE IF EXISTS  `spActualizarProductos` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spActualizarProductos`(_IDPRODUCTO INT,_TIPO INT,_MARCA INT,_MODELO VARCHAR(50),_STOCK INT,_PRECIOPUNTO INT,_PRECIOVENTA INT,_USUARIO INT)
BEGIN
	UPDATE producto 
	SET	tipo = _TIPO , 
		marca = _MARCA , 
		modelo = _MODELO , 
		stock = _STOCK , 
		preciopunto = _PRECIOPUNTO,
		precioventa = _PRECIOVENTA,
		usumod = _USUARIO, 
		fecmod = NOW() 	
	WHERE	idproducto = _IDPRODUCTO;
	SELECT idproducto from producto WHERE idproducto = _IDPRODUCTO;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `spActualizarTrabajo` */

/*!50003 DROP PROCEDURE IF EXISTS  `spActualizarTrabajo` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spActualizarTrabajo`(_IDTRABAJO INT,_PRECIO INT,_USUARIO INT)
BEGIN
	UPDATE trabajos 
	SET	precio= _PRECIO , 
		usumod = _USUARIO, 
		fecmod = NOW() 	
	WHERE	idtrabajos = _IDTRABAJO;
	SELECT idtrabajos from trabajos WHERE idtrabajos = _IDTRABAJO;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `spBuscarLibroBancos` */

/*!50003 DROP PROCEDURE IF EXISTS  `spBuscarLibroBancos` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spBuscarLibroBancos`(_CP VARCHAR(50))
BEGIN
SELECT 	idlibrobancos, 
	presupuesto, 
	beneficiario, 
	fecha, 
	siaf, 
	cheque, 
	cp, 
	tr, 
	debe, 
	haber	 
	FROM 
	librobancos 
	WHERE cp LIKE CONCAT('%',_CP ,'%')
	ORDER BY idlibrobancos DESC
	LIMIT 0, 20;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `spConsultaProducto` */

/*!50003 DROP PROCEDURE IF EXISTS  `spConsultaProducto` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spConsultaProducto`(_TIPO VARCHAR(50),_MARCA VARCHAR(50),_MODELO VARCHAR(50))
BEGIN
	SELECT P.idproducto,S1.DESCRIPCION TIPO ,S2.DESCRIPCION MARCA,P.MODELO,P.STOCK,P.PRECIOVENTA,P.PRECIOPUNTO
	  FROM PRODUCTO P INNER JOIN SUBTABLA S1 ON P.TIPO=S1.CODIGO
						AND S1.IDTABLA='5'
			  INNER JOIN SUBTABLA S2 ON P.MARCA=S2.CODIGO
						AND S2.IDTABLA='4'
	 WHERE S1.DESCRIPCION=_TIPO
	   AND S2.DESCRIPCION=_MARCA
	   AND P.MODELO LIKE CONCAT('%',_MODELO ,'%');
    END */$$
DELIMITER ;

/* Procedure structure for procedure `spConsultaTrabajos` */

/*!50003 DROP PROCEDURE IF EXISTS  `spConsultaTrabajos` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spConsultaTrabajos`(_TIPOTRABAJO VARCHAR(50),_MARCA VARCHAR(50),_MODELO VARCHAR(50))
BEGIN
	SELECT T.idtrabajos,S1.DESCRIPCION TIPO ,S2.DESCRIPCION MARCA,C.MODELO,T.PRECIO
	  FROM TRABAJOS T INNER JOIN CELULAR C ON T.IDCELULAR=C.IDCELULAR
			  INNER JOIN SUBTABLA S1 ON T.IDTIPOTRABAJO=S1.CODIGO
						AND S1.IDTABLA='6'
			  INNER JOIN SUBTABLA S2 ON C.MARCA=S2.CODIGO
						AND S2.IDTABLA='4'
	 WHERE S1.DESCRIPCION=_TIPOTRABAJO
	   AND S2.DESCRIPCION=_MARCA
	   AND C.MODELO LIKE CONCAT('%',_MODELO ,'%');
    END */$$
DELIMITER ;

/* Procedure structure for procedure `spObtenerDatosPersonal` */

/*!50003 DROP PROCEDURE IF EXISTS  `spObtenerDatosPersonal` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spObtenerDatosPersonal`(_IDPERSONAL INT)
BEGIN
		SELECT UPPER(CONCAT(e.apepat,'-',e.apemat,'-',e.nombre,'-',s.descripcion)) DATOS
		FROM personal e INNER JOIN subtabla s ON e.cargo=s.codigo  
		WHERE s.idtabla='4' AND e.idPersonal=_IDPERSONAL;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `spRegistrarCelular` */

/*!50003 DROP PROCEDURE IF EXISTS  `spRegistrarCelular` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spRegistrarCelular`(_MARCA INT,_MODELO VARCHAR(50),_USUARIO INT)
BEGIN
	DECLARE cant INT;
	SELECT COUNT(*) INTO cant FROM celular WHERE  marca=_MARCA AND modelo=_MODELO;
	IF cant=0 THEN 
		INSERT INTO celular 
			(idcelular,marca, modelo, usureg, fecreg)
			VALUE (NULL,_MARCA,_MODELO,_USUARIO, NOW());
		SELECT @@identity AS idcelular;
	ELSE
		SELECT idcelular FROM celular WHERE  marca=_MARCA AND modelo=_MODELO;
	END IF;
    END */$$
DELIMITER ;

