/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spRegistrarProductos`(_TIPO INT,_MARCA INT,_MODELO VARCHAR(50),_STOCK INT,_PRECIOPUNTO INT,_PRECIOVENTA INT,_USUARIO INT)
