/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spRegistroMovimientosDia`(_FECHA VARCHAR(50),_VENTATOTAL DECIMAL(10,2),_GASTOS DECIMAL(10,2),_EFECTIVO DECIMAL(10,2),_USUARIO INT)
