/* Procedure structure for procedure `spValidacionUsuario` */

/*!50003 DROP PROCEDURE IF EXISTS  `spValidacionUsuario` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spValidacionUsuario`(_varUsuario VARCHAR(40),_varClave VARCHAR(20),_idEmpresa int)
BEGIN
	SELECT u.idusuario,p.idpersonal,p.nombre,CONCAT(p.apepat,' ',p.apemat) apellidos,e.razonsocial,r.rol,e.idempresa
	FROM usuario u INNER JOIN personal p ON u.idpersonal=p.idpersonal
		       INNER JOIN empresa e ON u.idempresa=e.idempresa
		       INNER JOIN rol_usuario r ON u.idusuario=r.usuario
	WHERE u.usuario=_varUsuario
	  AND u.clave=_varClave
	  AND u.estado=1
	  AND p.estado=1
	  AND r.estado=1;
    END */$$
DELIMITER ;

